import React from 'react'
import classes from './Task.css'

const Task = (props)=>{
    return(
        <div className={classes.Task}>
        {props.task.map((obj, index)=>{
            return(
                <li key={index}>
                    {obj.nameOfTask}
                </li>
            )

        })}
        </div>
    )


};

export default Task
